import React from 'react';
import animage from './me1.JPG';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="App-navbar"> 
      <div className="App-display1">About Me</div>

      <div className="App-display2">Projects</div>

      </div>
      <div className="App-middle">Middle section</div>
      <div className="App-right">
        <img src={animage} className="App-logo" alt="logo" />
      </div>
      <footer className="App-footer">
          <a
          className="App-link"
          href="https://wearecodenation.com/courses/coding/master/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Code Nation 
        </a>
      </footer>

    </div>
  );
}

export default App;
